import classes from './AvailableMeals.module.css';
import Card from '../UI/Card';
import MealItem from './MealItem/MealItem';

const DUMMY_MEALS = [
  {
    id: 'm1',
    name: 'Kiaulienos Karbonadas',
    description: 'Su ryžiais',
    price: 3.49,
  },
  {
    id: 'm2',
    name: 'Kijevo Kotletas',
    description: 'Su bulvių koše',
    price: 16.5,
  },
  {
    id: 'm3',
    name: 'Cepelinai',
    description: 'Su mėsa',
    price: 12.99,
  },
  {
    id: 'm4',
    name: 'Blynai',
    description: 'Su varške',
    price: 12.99,
  },
];

const AvailableMeals = () => {
  const mealsList = DUMMY_MEALS.map((meal) => (
    <MealItem
      key={meal.id}
      id={meal.id}
      name={meal.name}
      description={meal.description}
      price={meal.price}
    />
  ));

  return (
    <section className={classes.meals}>
      <Card>
        <ul>{mealsList}</ul>
      </Card>
    </section>
  );
};

export default AvailableMeals;
